import React from 'react';

const containerStyle = {
  padding: '4rem',
  backgroundColor: '#f5f5f5',
};

const mainContainerStyle = {
  maxWidth: '1200px',
  margin: '0 auto',
};

const titleStyle = {
  textAlign: 'center',
  fontSize: '2.5rem',
  fontWeight: '700',
  marginBottom: '3rem',
  color: '#333',
};

const sectionStyle = {
  padding: '2rem',
  backgroundColor: '#ffffff',
  borderRadius: '12px',
  boxShadow: '0px 6px 15px rgba(0, 0, 0, 0.1)',
  marginBottom: '2rem',
  textAlign: 'center',
};

const sectionTitleStyle = {
  fontSize: '1.8rem',
  fontWeight: '600',
  marginBottom: '1.5rem',
  color: '#007396',  // Java-like theme color for section titles
};

const badgeContainerStyle = {
  display: 'flex',
  flexWrap: 'wrap',
  justifyContent: 'center',
  gap: '1rem',
};

const badgeStyle = {
  margin: '5px',
};

const sectionWrapperStyle = {
  display: 'flex',
  flexWrap: 'wrap',
  justifyContent: 'center',
  gap: '2rem',
};

const Skills = () => {
  return (
    <section id="Skills" style={containerStyle}>
      <div style={mainContainerStyle}>
        <h2 style={titleStyle}>My Skills</h2>

        <div style={sectionWrapperStyle}>
          {/* Frontend Section */}
          <div style={sectionStyle}>
            <h3 style={sectionTitleStyle}>Frontend</h3>
            <div style={badgeContainerStyle}>
              <img src="https://img.shields.io/badge/-JavaScript-F7DF1E?style=flat&logo=javascript&logoColor=black" alt="JavaScript" style={badgeStyle} />
              <img src="https://img.shields.io/badge/-HTML5-E34F26?style=flat&logo=html5&logoColor=white" alt="HTML5" style={badgeStyle} />
              <img src="https://img.shields.io/badge/-CSS3-1572B6?style=flat&logo=css3&logoColor=white" alt="CSS3" style={badgeStyle} />
              <img src="https://img.shields.io/badge/-React-61DAFB?style=flat&logo=react&logoColor=black" alt="React" style={badgeStyle} />
            </div>
          </div>

          {/* Backend Section */}
          <div style={sectionStyle}>
            <h3 style={sectionTitleStyle}>Backend</h3>
            <div style={badgeContainerStyle}>
              <img src="https://img.shields.io/badge/-Java-007396?style=flat&logo=java&logoColor=white" alt="Java" style={badgeStyle} />
              <img src="https://img.shields.io/badge/-Node.js-339933?style=flat&logo=node.js&logoColor=white" alt="Node.js" style={badgeStyle} />
              <img src="https://img.shields.io/badge/-CSharp-239120?style=flat&logo=c-sharp&logoColor=white" alt="C#" style={badgeStyle} />
              <img src="https://img.shields.io/badge/-C++-00599C?style=flat&logo=c%2B%2B&logoColor=white" alt="C++" style={badgeStyle} />
            </div>
          </div>

          {/* MERN Stack Section */}
          <div style={sectionStyle}>
            <h3 style={sectionTitleStyle}>MERN Stack</h3>
            <div style={badgeContainerStyle}>
              <img src="https://img.shields.io/badge/-MongoDB-47A248?style=flat&logo=mongodb&logoColor=white" alt="MongoDB" style={badgeStyle} />
              <img src="https://img.shields.io/badge/-Express.js-000000?style=flat&logo=express&logoColor=white" alt="Express.js" style={badgeStyle} />
              <img src="https://img.shields.io/badge/-React-61DAFB?style=flat&logo=react&logoColor=black" alt="React" style={badgeStyle} />
              <img src="https://img.shields.io/badge/-Node.js-339933?style=flat&logo=node.js&logoColor=white" alt="Node.js" style={badgeStyle} />
            </div>
          </div>

          {/* Testing Section */}
          <div style={sectionStyle}>
            <h3 style={sectionTitleStyle}>Testing</h3>
            <div style={badgeContainerStyle}>
              <img src="https://img.shields.io/badge/-Selenium-43B02A?style=flat&logo=selenium&logoColor=white" alt="Selenium" style={badgeStyle} />
              <img src="https://img.shields.io/badge/-JUnit-25A162?style=flat&logo=junit5&logoColor=white" alt="JUnit" style={badgeStyle} />
            </div>
          </div>

          {/* Tools & Platforms Section */}
          <div style={sectionStyle}>
            <h3 style={sectionTitleStyle}>Tools & Platforms</h3>
            <div style={badgeContainerStyle}>
              <img src="https://img.shields.io/badge/-Git-F05032?style=flat&logo=git&logoColor=white" alt="Git" style={badgeStyle} />
              <img src="https://img.shields.io/badge/-GitHub-181717?style=flat&logo=github&logoColor=white" alt="GitHub" style={badgeStyle} />
              <img src="https://img.shields.io/badge/-Docker-2496ED?style=flat&logo=docker&logoColor=white" alt="Docker" style={badgeStyle} />
              <img src="https://img.shields.io/badge/-Visual_Studio_Code-007ACC?style=flat&logo=visual-studio-code&logoColor=white" alt="VS Code" style={badgeStyle} />
            </div>
          </div>

          {/* Database Section */}
          <div style={sectionStyle}>
            <h3 style={sectionTitleStyle}>Database</h3>
            <div style={badgeContainerStyle}>
              <img src="https://img.shields.io/badge/-MySQL-4479A1?style=flat&logo=mysql&logoColor=white" alt="MySQL" style={badgeStyle} />
              <img src="https://img.shields.io/badge/-PostgreSQL-336791?style=flat&logo=postgresql&logoColor=white" alt="PostgreSQL" style={badgeStyle} />
              <img src="https://img.shields.io/badge/-NoSQL-F26522?style=flat&logo=mongodb&logoColor=white" alt="NoSQL" style={badgeStyle} />
            </div>
          </div>

          {/* Cloud & DevOps Section */}
          <div style={sectionStyle}>
            <h3 style={sectionTitleStyle}>Cloud & DevOps</h3>
            <div style={badgeContainerStyle}>
              <img src="https://img.shields.io/badge/-AWS-232F3E?style=flat&logo=amazon-aws&logoColor=white" alt="AWS" style={badgeStyle} />
              <img src="https://img.shields.io/badge/-Azure-0078D4?style=flat&logo=microsoft-azure&logoColor=white" alt="Azure" style={badgeStyle} />
              <img src="https://img.shields.io/badge/-Jenkins-D24939?style=flat&logo=jenkins&logoColor=white" alt="Jenkins" style={badgeStyle} />
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Skills;
